const t=e=>{const l=document.getElementById(e.getAttribute("aria-controls"));l.type==="password"?(l.type="text",e.children.item(0).style.display="none",e.children.item(1).style.display="block",e.setAttribute("aria-label",e.dataset.labelHide)):l.type==="text"&&(l.type="password",e.children.item(0).style.display="block",e.children.item(1).style.display="none",e.setAttribute("aria-label",e.dataset.labelShow))};document.querySelectorAll("[data-password-toggle]").forEach(e=>e.onclick=()=>t(e));
